  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Quivira
  National Wildlife Refuge summarizes refuge activities during the 1995 calendar year.
  \ The report begins with a summary of the years highlights and climatic conditions.
  \  Land acquisition is also covered.  The report includes a planning section which
  discusses research and investigations.  Refuge administration is outlined; information
  about personnel, youth programs, volunteer programs, funding, safety, technical
  assistance, and other items is given.  Habitat management is also covered.  Subjects
  include general, wetlands, croplands, grasslands, grazing, fire management, pest
  control, water rights, wilderness and special areas.  The wildlife section of the
  report discusses wildlife diversity, endangered andor threatened species, waterfowl,
  marsh and waterbirds, shorebirds, gulls, terns, and allied species, raptors, other
  migratory birds, games animals, other resident wildlife, fishery resource, animal
  control.  The public uses of the refuge described in this report include general,
  outdoor classrooms students, outdoor classrooms teachers, interpretive foot trails,
  interpretive tour routes, interpretive exhibitsdemonstrations, other interpretive
  programs, hunting, fishing, wildlife observation, other wildlife oriented recreation,
  law enforcement.  The equipment and facilities section of the report provides information
  about new construction, rehabilitation, major maintenance, equipment utilization
  and replacement.  Items of interest are provided at the end.\",\n\t\"license_title\":
